webpackJsonp([1236],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-arrayprototypesort.json":function(e,r){e.exports={data:{markdownRemark:{html:"<p>The <code>sort()</code> method sorts the elements of an array <em>in place</em> and returns the sorted array.</p>\n<h3>Syntax</h3>\n<pre><code>arr.sort([compareFunction])\n</code></pre>\n<h2>Parameters</h2>\n<table>\n<thead>\n<tr>\n<th>Parameter</th>\n<th>Description</th>\n<th>Necessity</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>compareFunction</td>\n<td>Optional. The name of the function used to determine the order of the elements. If omitted, the elements are sorted in ascending, Unicode character order.</td>\n<td>Optional</td>\n</tr>\n</tbody>\n</table>\n<p><a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/sort\">MDN link</a> | <a href=\"https://msdn.microsoft.com/en-us/LIBRary/4b4fbfhk(v=vs.94).aspx\">MSDN link</a></p>\n<h2>Returns</h2>\n<p>The sorted array.</p>\n<h2>Remarks</h2>\n<p>The <code>sort</code> method sorts the <code>Array</code> object in place; no new <code>Array</code> object is created during execution.</p>\n<p>If you supply a function in the <code>compareFunction</code> argument, it must return one of the following values:</p>\n<ul>\n<li>\n<p>A negative value if the first argument passed is less than the second argument.</p>\n</li>\n<li>\n<p>Zero if the two arguments are equivalent.</p>\n</li>\n<li>\n<p>A positive value if the first argument is greater than the second argument.</p>\n</li>\n</ul>\n<h2>Examples</h2>\n<pre><code>var fruit = ['cherries', 'apples', 'bananas'];\nfruit.sort(); // ['apples', 'bananas', 'cherries']\n\nvar scores = [1, 10, 2, 21]; \nscores.sort(); // [1, 10, 2, 21]\n// Watch out that 10 comes before 2,\n// because '10' comes before '2' in Unicode code point order.\n\nvar things = ['word', 'Word', '1 Word', '2 Words'];\nthings.sort(); // ['1 Word', '2 Words', 'Word', 'word']\n// In Unicode, numbers come before upper case letters,\n// which come before lower case letters.\n\nvar a = new Array(4, 11, 2, 10, 3, 1);\n\nvar b = a.sort();\ndocument.write(b);\ndocument.write(\"&#x3C;br/>\");\n\n// This is ASCII character order.\n// Output: 1,10,11,2,3,4)\n\n// Sort the array elements with a function that compares array elements.\nb = a.sort(CompareForSort);\ndocument.write(b);\ndocument.write(\"&#x3C;br/>\");\n// Output: 1,2,3,4,10,11.\n\n// Sorts array elements in ascending order numerically.\nfunction CompareForSort(first, second)\n{\n    if (first == second)\n        return 0;\n    if (first &#x3C; second)\n        return -1;\n    else\n        return 1; \n}\n</code></pre>",frontmatter:{title:"javaScript Arrayprototypesort",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-arrayprototypesort/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-arrayprototypesort/"}}}});
